const Navbar = (props) => {



    return (
        <nav className={props.class}>
            <p>{props.name}</p>
            <ul>
                {props.links.map((page) => <a href={page.link}><li>{page.name}</li></a>)}
            </ul>
        </nav>
    )
}

export default Navbar;
